import React from 'react';
import '../../App.css';
import Footer from '../Footer';
import CaroCard from '../CaroCard';

function About(){
  return (
    <>
      <div class="container">
        <h1 className='about'>ABOUT</h1>
        <CaroCard /> 
        <Footer />
      </div>
    </>
 );
}

export default About;
